import type { Aircraft } from "$lib/models/aircraft";

enum PositionSource {
    ADSB = 0,
    ASTERIX = 1,
    MLAT = 2,
    FLARM = 3
}

enum AircraftCategory {
    NoInformation = 0,
    NoADSBEmitterCatetoryInformation = 1,
    Light = 2,
    Small = 3,
    Large = 4,
    HighVortexLarge = 5,
    Heavy = 6,
    HighPerformace = 7,
    Rotorcraft = 8,
    GliderSailplane = 9,
    LighterThanAir = 10,
    Parachutist = 11,
    Ultralight = 12,
    Reserved = 13,
    UnmannedAerialVehicle = 14,
    SpaceTransAtomsphericVehicle = 15,
    SurfaceVehicleEmergency = 16,
    SurfacevehicleService = 17,
    PointObstacle = 18,
    ClusterObstacle = 19,
    LineObstacle = 20
}

interface Flight {
    icao24: string,
    callsign: string,
    originCountry: string,
    timePosition: number,
    lastContact: number,
    longitude: number | null,
    latitude: number | null,
    baroAltitude: number | null,
    onGround: boolean,
    velocity: number | null,
    trueTrack: number | null,
    verticalRate: number | null,
    sensors: number[] | null,
    geoAltitude: number | null,
    squawk: string | null,
    spi: boolean,
    positionSource: PositionSource,
    //category: AircraftCategory
}

interface State {
    0: string,
    1: string,
    2: string,
    3: number,
    4: number,
    5: number | null,
    6: number | null,
    7: number | null,
    8: boolean,
    9: number | null,
    10: number | null,
    11: number | null,
    12: number[] | null,
    13: number | null,
    14: string | null,
    15: boolean,
    16: PositionSource
}

interface States {
    time: number,
    states: State[] 
}

export const getFlights = async ():Promise<Flight[]> => {

    const flightStates = await mockOpenSkyApiGetState();

    return flightStates.states.map(item => (
        {
            icao24: item[0],
            callsign: item[1],
            originCountry: item[2],
            timePosition: item[3],
            lastContact: item[4],
            longitude: item[5],
            latitude: item[6],
            baroAltitude: item[7],
            onGround: item[8],
            velocity: item[9],
            trueTrack: item[10],
            verticalRate: item[11],
            sensors: item[12],
            geoAltitude: item[13],
            squawk: item[14],
            spi: item[15],
            positionSource: item[16]
        }
    ));

}


